import React,{Component} from 'react';
import EmployeePersonalDetails from '../components/EmployeeMasterPersonal';
import EmployeeMasterBank from '../components/EmployeeMasterBank';
import EmployeeMasterIdentification from '../components/EmployeeMasterIdentification';
import EmployeeMasterOffice from '../components/EmployeeMasterOffice';
import {Tab, Nav, NavItem, NavLink, TabContent, Navbar} from "reactstrap";
import TabPane from "react-bootstrap/es/TabPane";

export default class EmployeeMaster extends Component{
    constructor(props){
        super(props)
        this.toggle =  this.toggle.bind(this)
        this.state = {
            activeTab : '1'
        }
    }
    toggle(tab){
        if(this.state.activeTab !== tab) {
            this.setState({activeTab: tab})
        }
    }
 render() {
     return(
         <div>
             <Navbar>
             <Nav tabs>
                 <NavItem>
                     <NavLink>Personal</NavLink>
                 </NavItem>
                 <NavItem>
                     <NavLink>Office</NavLink>
                 </NavItem>
                 <NavItem>
                     <NavLink>Bank</NavLink>
                 </NavItem>
                 <NavItem>
                     <NavLink>Identification</NavLink>
                 </NavItem>
             </Nav>
             </Navbar>
             <TabContent activeTab= {this.state.activeTab}>
                 <TabPane tabID = "1">
                     <EmployeePersonalDetails />
                 </TabPane>
                 <TabPane tabID = "2">
                     <EmployeeMasterOffice />
                 </TabPane>
                 <TabPane tabID = "3">
                     <EmployeeMasterBank />
                 </TabPane>
                 <TabPane tabID = "4">
                     <EmployeeMasterIdentification />
                 </TabPane>
             </TabContent>
         </div>
     );
 }
}
